import React from 'react'
import { ListContainer, ListDescription, ListTitle } from './Styles'


function ItemList({title, description, language}) {
  return (
    <ListContainer>
        <>
        <ListTitle>{title}</ListTitle>
        <ListDescription>
          {description}
          <br/>
          languages: {language}
        </ListDescription>
        <hr/>
        </>
    </ListContainer>
  )
}

export default ItemList
